def count_substrings(s, k):
    def at_most_k_chars(window, char, k):
        return sum(1 for c in window if c == char) <= k

    n = len(s)
    total_count = 0
    left = 0

    for right in range(n):
        while not (at_most_k_chars(s[left:right+1], '0', k) or at_most_k_chars(s[left:right+1], '1', k)):
            left += 1
        total_count += right - left + 1

    return total_count

